import ubinascii
import uos
import hub

b64=""""""
binary=ubinascii.a2b_base64(b64)

#古いファイルを削除
try:
    uos.remove('/projects/touch_sensor_array.mpy')
    print("deleted")
except OSError:
    pass

#書き込み
with open('/projects/touch_sensor_array.mpy','wb') as f:
    f.write(binary)
print("Written")

#再起動
hub.repl_restart(True)
